function setInputVal(d){d.blockStr.str=d.task.info.alg_answer||d.ds;d.blockStr.str=d.blockStr.str.replace(/[^0-9]/g,"0");if(d.n==8){d.blockStr.str=d.blockStr.str.length!=8?d.ds:d.blockStr.str;if(d.blockStr.str.substring(0,4)<minYear||d.blockStr.str.substring(0,4)>maxYear||d.blockStr.str.substring(4,6)>12||d.blockStr.str.substring(6,8)>31){console.log("结果不是日期格式");d.blockStr.str=d.today}}else{var c=d.n-d.blockStr.str.length,g="";if(c>0){for(var e=0;e<c;e++){g+="0"}d.blockStr.str=g+d.blockStr.str}else{d.blockStr.str=d.blockStr.str}}var a=$("#codeLockWrap input.ansNum");var b;for(var e=0;e<d.n;e++){a[e].value=d.blockStr.str[e];a[e].onfocus=function(){b=this.value;this.value=""};a[e].onblur=function(){if(!this.value){this.value=b}};a[e].onkeyup=function(){this.blur()}}}getCurStr=function(){var c=[];var a=$("#codeLockWrap input.ansNum");for(var b=0,d=a.length;b<d;b++){c[b]=a[b].value}return c.join("")};